export default function ItemList({
category,
  notebookProduct,
  desktopProduct,
}) {
    // console.log(notebookProduct);
    // console.log(desktopProduct)
  return (
    <div>
      {(category == "notebook") ? (
       notebookProduct.map(function(item){
           return (<div>{notebookProduct[item].id}</div>);
       }))
       : (
       <h1>{JSON.stringify(desktopProduct)}</h1>
      )}
    </div>
  );
}
